con:config.script:
import groovy.sql.Sql
log.info "Start"


String userName = context.expand('brp')
String password = context.expand('brp')
String url      = context.expand('jdbc:postgresql://localhost/brp')
//String url      = "jdbc:postgresql://localhost/brplokaal"
String driver   = context.expand('${#Project#jdbcDriver}')
String projectDir = context.expand('${#Project#projectDir}')
String cleanupSql = context.expand('${#Project#cleanSql}')


com.eviware.soapui.support.GroovyUtils.registerJdbcDriver("org.postgresql.Driver")


//Class.forName("org.postgresql.Driver");


def props = [user: userName, password: password, allowMultiQueries: 'true'] as Properties;
def sql = Sql.newInstance(url, props, driver);




log.info (projectDir + "/" + cleanupSql)
sql.execute new File(projectDir, cleanupSql).text;

sql.close();


log.info "Einde"

con:soapui-project.con:afterLoadScript:
//Dit script voegt toe entries in de project properties, de gebruikt kan worden
// binnen dit project
import java.text.DateFormat
import java.text.SimpleDateFormat

import static java.util.Calendar.MONTH
import static java.util.Calendar.YEAR

def today = new Date()

project.setPropertyValue( "vandaag", new SimpleDateFormat("yyyy-MM-dd").format(new Date()))
project.setPropertyValue( "gisteren", new SimpleDateFormat("yyyy-MM-dd").format(new Date().minus(1)))
project.setPropertyValue( "vandaag-5", new SimpleDateFormat("yyyy-MM-dd").format(new Date().minus(5)))
project.setPropertyValue( "vorigweek", new SimpleDateFormat("yyyy-MM-dd").format(new Date().minus(7)))
project.setPropertyValue( "morgen", new SimpleDateFormat("yyyy-MM-dd").format(new Date().plus(1)))
project.setPropertyValue( "volgendmaand", new SimpleDateFormat("yyyy-MM-dd").format(new Date().updated(month: today[MONTH] + 1)))
project.setPropertyValue( "vorigmaand", new SimpleDateFormat("yyyy-MM-dd").format(new Date().updated(month: today[MONTH] - 1)))
project.setPropertyValue( "volgendjaar", new SimpleDateFormat("yyyy-MM-dd").format(new Date().updated(year: today[YEAR] + 1)))
project.setPropertyValue( "vorigjaar", new SimpleDateFormat("yyyy-MM-dd").format(new Date().updated(year: today[YEAR] - 1)))

project.setPropertyValue( "actieTijdstip", new SimpleDateFormat("yyyyMMddHHmmssSS").format(new Date()))


def projectDir = context.expand('${projectDir}');

project.setPropertyValue("projectDir",context.expand('${projectDir}'))

// Laad nu de project settings, deze wordt alleen uitgevoerd als SOAPUI wordt gestart vanaf de command line.
// bij de GUI, dient men deze met expliciet de hand te laden
// Als geen paramaeter wordt meegeleverd, haal de ENV definitie uit de ENV/omgeving.properties; deze verwijst welk omgeving geladen moet worden.
// In de env.proprtes staat de settings voor endpointURL(s), en dataasource indormatie.
// -------------------------------------------
//if(com.eviware.soapui.SoapUI.isCommandLine()){
	def conf_env = com.eviware.soapui.SoapUI.globalProperties.getPropertyValue("projectEnv")
	if (conf_env != null) {
		log.info ("--------- projectEnv is define through the command line: [" + conf_env +"]")
		project.setPropertyValue( "ENV", conf_env)
	} else {
		// laad de omgeving gedefinieerd in de ./ENV/omgeving.properties
		log.warn ("--------- projectEnv is niet meegeleverd via commandline, gebruikt de waarde opgeslagen in ./ENV/omgeving.properties.")
		loadPropertiesFromFile(projectDir + "/" + "ENV", "omgeving.properties")
		log.warn ("--------- geladen wordt : " + project.getPropertyValue("ENV"))
	}

	// read the file(s)
	loadPropertiesFromFile(projectDir + "/ENV/" +  project.getPropertyValue("ENV"), "env.properties" );

	def dataSetNaam = com.eviware.soapui.SoapUI.globalProperties.getPropertyValue("dataSetNaam")
	if (dataSetNaam == null) {
		dataSetNaam = "Utrecht";
	}
	project.setPropertyValue( "dataSetNaam", dataSetNaam)
	log.info ("--------- dataSetNaam : [" + dataSetNaam + "]")
	project.setPropertyValue( "dataSet", "data/dataSet"+dataSetNaam+".properties")
	project.setPropertyValue( "cleanSql", "data/cleanSql"+dataSetNaam+".sql")

	loadPropertiesFromFile(projectDir + "/", project.getPropertyValue("dataSet") );
//}

void loadPropertiesFromFile(String dir, String filename) {
	def properties = new java.util.Properties();
	properties.load( new java.io.FileInputStream( new File(dir, filename)));
	log.info("Goed geladen bestand: "+ dir + "/" + filename);
	def names = [];
	names =  properties.propertyNames();
	while( names.hasMoreElements() ) {
		def name = names.nextElement();
		 project.setPropertyValue(name, properties.getProperty(name))
	}
}
